import React from "react";
import "./Nav.css"

class NavBar extends React.Component{
    render() {
      return (
        <nav>
            <ul>
                <li><img src="" alt="Airborne Logo"/></li>
            </ul>
        </nav>
      )
    }
}

export default NavBar;
